text.15:
@LaRetuerka El único resquicio de esperanza que me queda es confiar por lo que todos nosotros hemos aprendido a lo largo de nuestras vidas, y es la realidad. 

“Déjalo y que estampe” 

Creo que no hay nada con un buen baño de realidad y romperse la cara contra la pared.

text.78:
Aviso a navegantes;
Al que me meta en una lista, bloqueo inmediato, sea quien sea...
Acabo de bloquear dos cuentas con las que me seguia hace años por lo mismo.
